import React from 'react';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';

const imageFiles = [
  '/images/Carousel/photo1.png',
  '/images/Carousel/photo2.png'
];

function ChurchGallery() {
  return (
    <section className="p-8 bg-purple-50 text-purple-900">
      <h2 className="text-2xl font-bold mb-4">Church Gallery</h2>
      <Carousel
        autoPlay
        infiniteLoop
        showThumbs={false}
        showStatus={false}
        interval={4000}
      >
        {imageFiles.map((src, index) => (
          <div key={index}>
            <img
              src={src}
              alt={`Slide ${index + 1}`}
              className="rounded-xl max-h-[500px] object-cover w-full"
            />
          </div>
        ))}
      </Carousel>
    </section>
  );
}

export default ChurchGallery;
